import React, { Component } from 'react'

class Header extends Component {

  buscaImput = e =>{
    console.log(e)
  }
    render(){
        return(
          <>
              <header>
                <div className="logo">
                </div>
                <div className="busca">
                  <input type="text" placeholder="Busca" 
                  onkeydown={(e) => this.buscaImput(e)}
                  />
                </div>
              </header>

          </>

        )
    }
}

export default Header
